  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:26.797125\",\n\t\"name\": \"forest-management-plan-bombay-hook-national-wildlife-refuge-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The forest management plan outlines steps
  that will support the following refuge goals: 1) to provide habitat far nesting
  and migratory waterfowl, 2) to provide, maintain and enhance a diversity of tree
  species age classes of forest habitat suitable for a wide variety of indigenous
  species of wildlife and plants, 3) to reestablish Atlantic White Cedar on the refuge
  in small experimental plots. A naturally reproducing stand of cedar is the long
  term objective, 4) to provide compatible opportunities for wildlife oriented recreation,
  5) to provide a protective stand of nature hardwoods around an active bald eagle
  nest site. The plan includes a recommendation for the forest management of five
  hundred acres by Sussex County Forrester, Robert Tjaden.\",\n\t\"license_title\":
